import React from 'react'
import {Link , NavLink} from 'react-router-dom'



const Navbar = () =>{
    return(
        <div>
            <Link to="/">Home</Link>
            <Link to="/Contact">Contact</Link>
        </div>
    )
}


export default Navbar;
